svg.script:
function getRndInteger(min, max) {
    return Math.floor(Math.random() * (max - min + 1) ) + min;
}

document.querySelectorAll("[id*='people']").forEach(function(el) {
	el.style.transform = 'translate(' + getRndInteger(-350, 50) + 'px, ' + getRndInteger(-20, 350) + 'px)';
	el.style.opacity = '0';

	el.style.animation = 'back-in-place ' + getRndInteger(1,2) + 's 1s ease-in-out both' ;
});
